import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';

const  NavbarComponent = () => {
  return (
    <Navbar bg="light" expand="lg">
      <Container>
        <Navbar.Brand href="#home">E-Ticaret</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto">
            <Nav.Link href="#home">Home</Nav.Link>
            <Nav.Link href="#link">Link</Nav.Link>
            <NavDropdown title="Categories" id="basic-nav-dropdown">
              <NavDropdown.Item href="/categories/telefon">Telefon</NavDropdown.Item>
              <NavDropdown.Item href="/categories/dizustu">Dizüstü Bilgisayar</NavDropdown.Item>
              <NavDropdown.Item href="/categories/parfum">Parfüm</NavDropdown.Item>
              <NavDropdown.Item href="/categories/ciltbakim">Cilt Bakım</NavDropdown.Item>
              <NavDropdown.Item href="/categories/supermarket">Süper Market</NavDropdown.Item>
            </NavDropdown>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default NavbarComponent;
